import React from 'react';
import s from './Header.module.css';

const Header = () => {
    return (
        <header className={s.header}>
            <img src="https://www.logodesign.net/logo-new/owl-on-scale-legal-icon-6854ld.png" alt="logo"/>
        </header>
    );
};

export default Header;
